INSERT INTO `rules` (`id`, `describtion`, `created_at`, `updated_at`) VALUES
(1, 'الشروط والأحكام\r\nإن استعمالك لتطبيق ميسان يعني موافقتك على اتفاقية الاستخدام والتي تنص على :\r\n١-أن تطبيق ميسان غير مسؤول بأي شكل من الأشكال عن مصداقية الهدايا من عدمها وأن المسؤولية تقع كاملة على صاحب الهدية. \r\n٢- استعمالك لحسابك داخل التطبيق بشكل مخالف ( كوضع هدايا وهمية ونحوها )يؤدي لإيقاف حسابك. \r\n٣- عدم تسجيلك لرقم جوالك بشكل صحيح قد يتسبب في عدم حصولك على الهدايا التي ينظمها تطبيق ميسان في حال فوزك بإحداها.\r\n٤- عند مخالفة هذه الأحكام أو مخالفة الأنظمة في المملكة العربية السعودية فيحق لنا حذف أو تعديل جميع البيانات داخل التطبيق دون الرجوع إلى أحد أو إبلاغه.\r\n٥- الشروط والأحكام قد تتغير في أي وقت دون إشعارك، ويجب عليك مراجعة الشروط والأحكام باستمرار\r\n', NULL, NULL);
